import React from 'react';
import {Form,Input,Button,Card,Layout,Typography} from "antd";
import styles from './styles';
import { UserOutlined } from '@ant-design/icons';

const {Title}=Typography;

export default function AuthForm() {
  const user=null;
  const {form}=Form.useForm();
  const onsubmit=()=>{

  }
  const isLogin=false;
    return (
   <Layout style={styles.container}>
    <Card style={styles.card}
    title={
        <Title level={4} style={{textAlign : "center"}}>
            {isLogin ? "Login to ":"Join"} Instaverse
        </Title>
    }>
        <Form
        name="authform"
        form={form}
        size="large"
        wrapperCol={{span:20,offset:2}}
        onFinish={onsubmit}
    >
        {isLogin || (
            <>
                <Form.Item 
                name="username"
                rules={[
                    {
                        required:true,
                    message:"Please Enter your username"
                    }
                ]}>
                    <Input prefix={<UserOutlined/> } placeholder="username"/>
                </Form.Item>
                </>
                )}
                <Form.Item 
                name="email"
                rules={[
                    {
                        required:true,
                    message:"Please Enter your valid email address"
                    }
                ]}>
                    <Input type="email" prefix={<MailOutlined/> } placeholder="email address"/>
                </Form.Item>
                <Form.Item 
                name="email"
                rules={[
                    {
                        required:true,
                    message:"Please Enter your password"
                    }
                ]}>
                    <Input.Password type="password" prefix={<LockOutlined/> } placeholder="password"/>
                </Form.Item>
        
        </Form>
    </Card>
   </Layout>
  )
}
